import React from 'react'
import styled from 'styled-components'
import 'HomePage.scss'

const MyContainer = styled.div`
    margin: 5rem 5rem 5rem 50rem;
    padding-top: 10rem;
    font-size: xx-large;
    background: #b3e5fc;
    @media (max-width: 780px){
        margin: 0;
        padding: 0; 
    }
`
function HomePage() {
    return (
        <MyContainer>
            <h1>Home Page</h1>
        </MyContainer>
    )
}

export default HomePage
